import { useContext } from 'react'
import { Theme } from '../../Context'

const Button = (props) => {

    const theme = Theme()

    return (
        <button style={{ backgroundColor: Theme.primary }} className='rounded-full py-1 px-3'>
            {props.children}
        </button>
    )
}

export default Button
